import "./CreateQuote.css";

function CreateQuote() {
  return (
    <div className="container">
      <form className="form">
        <div className="container">
          <input className="input"></input>
          <button type="submit" className="submitBtn">
            СОЗДАТЬ
          </button>
        </div>
      </form>
    </div>
  );
}

export default CreateQuote;
